INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOMO', 'STOCK', 'Domo, Inc.', 'NGM', 'Technology', 'Software - Application', 'Domo, Inc. provides a cloud-based platform is an artificial intelligence (AI) and data products platform that enables processes that are dependent on business intelligence data from marketing to operations, human resources to finance, information technology to product development, and supply chain to sales. Its platform enables every type of employee to connect to, analyze, and leverage data from their smartphone. Its platform provides real-time access to quantitative and qualitative data. Through the Domo platform, data from across the business is collected, stored, prepared, organized, analyzed, visualized, automated and distributed. AI algorithms and machine learning can be applied to the data. Its platform provides real-time access to data through a flexible set of connection options, including an application programming interface and standards-based connectors that are available in the Domo Appstore, and a library of flexible universal connectors.', 'American Fork, UT, United States', 888);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYCC', 'STOCK', 'Cyclacel Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cyclacel Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing cancer medicines based on cell cycle, epigenetics and mitosis biology. Its epigenetic/anti-mitotic program is evaluating plogo, a Polo-like kinase 1 (PLK1) inhibitor, in solid tumors and hematological malignancies. PLK1 is a serine/threonine kinase with a central role in cell division, or the mitotic phase of the cell cycle, and is a regulator of the DNA damage checkpoint. The Companys plogo is a novel, small-molecule, selective and potent PLK1 inhibitor, which has demonstrated potent and selective target inhibition (PLK1 IC50 approximately 3 nM) and efficacy in human tumor xenografts at non-toxic doses. Its translational biology program supports the development of plogo in solid tumor and hematological malignancy indications. PLK1 over-expressing tumors include colorectal, esophageal, gastric, leukemia, lung, lymphoma, ovarian and squamous cell cancers.', 'Kuala Lumpur, , Malaysia', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVT', 'STOCK', 'Avnet, Inc.', 'NMS', 'Technology', 'Electronics & Computer Distribution', 'Avnet, Inc. is a global electronic component technology distributor and solutions provider. It markets, sells, and distributes electronic components from electronic component manufacturers, including semiconductors, interconnect, passive and electromechanical components, and other integrated and embedded components. Its primary operating groups include Electronic Components (EC) and Farnell. EC serves a variety of markets ranging from industrial to automotive to defense and aerospace. EC offers an array of customer support options throughout the entire product lifecycle, including turnkey and customized design, supply chain, programming, logistics and post-sales services. The Farnell operating group primarily supports lower-volume customers and distributes a portfolio of kits, tools, electronic components, industrial automation components, and test and measurement products to both engineers and entrepreneurs, through an e-commerce channel. It also distributes new product introductions.', 'Phoenix, AZ, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRMA', 'STOCK', 'Dermata Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dermata Therapeutics, Inc. is a late-stage medical dermatology company. The Company is focused on identifying, developing, and commercializing pharmaceutical product candidates for the treatment of medical and aesthetic skin conditions and diseases. Its two product candidates, XYNGARI and DMT410, both incorporate its proprietary, multifaceted, Spongilla technology to topically treat a variety of dermatological conditions. Its lead product candidate, XYNGARI, is intended to utilize its Spongilla technology for once weekly treatment of a variety of skin diseases, with its initial focus being the treatment of acne vulgaris, which has a United States market size of approximately 30 million patients seeking treatment. The Companys second product candidate, DMT410, uses its XYNGARI product candidate as a new method for needle-free intradermal delivery of botulinum toxin for the treatment of multiple aesthetic applications and medical skin diseases.', 'San Diego, CA, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKAN', 'STOCK', 'Akanda Corp.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Akanda Corp. is a United Kingdom-based company, which is focused on the growth of its Canadian farming property in British Columbia. The Company plans to develop tetrahydrocannabinol (THC) and cannabidiol (CBD) facilities.', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TVGN', 'STOCK', 'Tevogen Bio Holdings Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Tevogen Bio Holdings Inc. is a clinical-stage specialty immunotherapy company. The Company is harnessing CD8+ cytotoxic T lymphocytes (CD8+ CTLs), to develop off-the-shelf, genetically unmodified precision T cell therapies for the treatment of infectious diseases, cancers, and neurological disorders, aiming to address the unmet needs of patient populations. Its first product candidate, TVGN 489, has developed to fill a critical gap in COVID-19 therapeutics for the immunocompromised and the high-risk elderly, with potential applications in both treatment and prevention of chronic lingering symptoms of the disease. Its TVGN 601 is being developed for multiple sclerosis (MS), and its TVGN 930 is being developed for EBV-associated lymphomas.', 'Warren, NJ, United States', 18);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBDC', 'STOCK', 'Barings BDC, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Barings BDC, Inc. is a closed-end, non-diversified investment company. The Companys investment objective is to generate current income by investing directly in privately held middle-market companies to help these companies fund acquisitions, growth or refinancing. The Company seeks to invest primarily in senior secured loans in middle-market companies that operate across a range of industries. It invests primarily in loans that have terms of between five and seven years, and bear interest at rates ranging from the London Interbank Offered Rate (LIBOR) (or an applicable successor rate) plus 450 basis points to LIBOR plus 650 basis points per annum. Its investment capabilities include first lien debt, unitranche, second lien debt and equity co-investments. It invests in various industries, including banking, finance, insurance and real estate, business, healthcare & pharmaceuticals, and others. Its investment activities are managed by its investment adviser, Barings LLC.', 'Charlotte, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PAYC', 'STOCK', 'Paycom Software, Inc.', 'NYQ', 'Technology', 'Software - Application', 'A Paycom Software, Inc. É fornecedora de uma solução abrangente de gerenciamento de capital humano (HCM) baseada na nuvem, fornecida como software como serviço (SaaS). A empresa fornece funcionalidade e análise de dados. Sua solução não requer praticamente nenhuma personalização e é baseada em um sistema central de registro mantido em um único banco de dados para todas as funções de HCM, incluindo aquisição de talentos, gerenciamento de tempo e mão de obra, folha de pagamento, gerenciamento de talentos e aplicativos de gerenciamento de recursos humanos (RH). Suas aplicações simplificam os processos do cliente e fornecem aos clientes e seus funcionários a capacidade de acessar e gerenciar diretamente processos administrativos, incluindo aplicativos que identificam candidatos, funcionários a bordo, gerenciam tempo e mão de obra, administram deduções e benefícios de folha de pagamento, gerenciam o desempenho, encerram funcionários e administram benefícios de saúde pós-término, como COBRA.', 'Oklahoma City, OK, United States', 7306);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CREV', 'STOCK', 'Carbon Revolution Public Limited Company', 'NGM', 'Consumer Cyclical', 'Auto Parts', 'Carbon Revolution plc is a technology company and original equipment manufacturer (OEM) supplier. The Company has commercialized and industrialized the supply of lightweight carbon fiber wheels to the automotive industry. The Company has progressed from single prototypes to designing and manufacturing lightweight wheels for cars and SUVs in the high performance, premium and luxury segments, for the automotive brands. It is focused on creating an advanced technology business that supplies its lightweight wheel technology to automotive manufacturers around the world. Its lightweight technology provides unparalleled improvements in performance, efficiency and handling, which translates to better drivability, fuel efficiency, range extension and reduction in lap times. Its applications include automotive, OEM, electric vehicles, aerospace, motorsport, and heavy vehicles. The Company is the parent of Carbon Revolution Pty Ltd.', 'Dublin, , Ireland', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIPC', 'STOCK', 'Brookfield Infrastructure Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Brookfield Infrastructure Corporation is a global infrastructure company. It owns and operates assets in the utilities, transport, midstream and data sectors across the Americas, Asia Pacific and Europe. Its operations include a United Kingdom-regulated distribution operation, a Brazilian regulated gas transmission operation and a global intermodal logistics operation. Its regulated gas transmission operation in Brazil operates over 2,000 kilometers of natural gas transportation pipelines in the states of Rio de Janeiro, Sao Paulo and Minas Gerais. Its regulated distribution operation is the independent last-mile, multi-utility connection provider, with approximately 4.5 million connections. Its global intermodal logistics operation is the lessor of intermodal containers with a fleet of four million containers representing seven million twenty-foot equivalent units. Operations include the acquisition, leasing, re-leasing, and subsequent sale of multiple types of intermodal containers.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DENN', 'STOCK', 'Denny''s Corporation', 'NCM', 'Consumer Cyclical', 'Restaurants', 'Denny''s Corporation is a franchised full-service restaurant chain. The Company owns and operates the Dennys brand (Dennys) and the Kekes Breakfast Cafe brand (Kekes). It operates in two segments: Dennys and Kekes. It has approximately 1,568 restaurants, 1,493 of which were franchised/licensed restaurants and 75 of which were Company-operated. The Dennys brand consists of over 1,499 franchised, licensed and company restaurants around the world, including 1,334 restaurants in the United States and 165 international restaurant locations. Dennys offers a wide selection of lunch and dinner items, including entrees, burgers, sandwiches and salads, along with an assortment of appetizers and desserts. It has four dayparts, breakfast, lunch, dinner and late night. Kekes is a daytime eatery dedicated to providing a breakfast experience. Kekes brand consists of over 69 franchised and company restaurants in the United States. Kekes also serves burgers, paninis, salads, and sandwiches.', 'Spartanburg, SC, United States', 3800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADTX', 'STOCK', 'Aditxt, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Aditxt, Inc. is a social innovation platform dedicated to accelerating promising health innovations. It develops and commercializes technologies with a focus on monitoring and modulating the immune system. Its portfolio includes Adimune, Inc., developing a new class of therapeutics designed to retrain the immune system to address organ rejection, autoimmunity, and allergies; Adivir, Inc., focused on identifying, developing, and commercializing new ways to treat infectious diseases, and Pearsanta, Inc., offering personalized lab testing, backed by CLIA-certified and CAP-accredited monitoring center. Adimune, Inc''s immune modulation product candidate, ADI-100, is based on the Apoptotic DNA Immunotherapy platform technology, utilizes a novel approach that mimics the way bodies naturally induce tolerance to own tissues. It also offers electroencephalography (EEG) brain monitoring technologies and devices, including NeuroCap and NeuroEEG for telehealth and tele-neurology applications.', 'Mountain View, CA, United States', 26);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNTH', 'STOCK', 'Dianthus Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dianthus Therapeutics, Inc. is a clinical-stage biotechnology company engaged in designing and delivering monoclonal antibodies with improved selectivity and potency. The Company is focused on developing complement therapeutics for patients living with severe autoimmune and inflammatory diseases. Its advanced product candidate, DNTH103, is a clinical-stage, highly potent, selective and fully human monoclonal immunoglobulin G4 with picomolar binding affinity that is designed to selectively bind only to the active form of C1s. DNTH103 is engineered with YTE half-life extension technology, a specific three amino acid change in the Fc domain, and has a pharmacokinetic (PK) profile designed to support less frequent, lower dose, self-administration as a convenient S.C. injection. It is conducting three mid- to late-stage clinical trials with DNTH103 in generalized Myasthenia Gravis (gMG), Chronic Inflammatory Demyelinating Polyneuropathy (CIDP), and Multifocal Motor Neuropathy (MMN).', 'New York, NY, United States', 78);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNMD', 'STOCK', 'CONMED Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'CONMED Corporation is a medical technology company, which provides devices and equipment for surgical procedures. Its products are used by surgeons and other healthcare professionals in a variety of specialties, including orthopedics, general surgery, gynecology, thoracic surgery and gastroenterology. Its product lines consist of orthopedic surgery and general surgery. Orthopedic surgery consists of sports medicine instrumentation and lower extremities instrumentation and implants, small bone, large bone and specialty-powered surgical instruments as well as imaging systems for use in minimally invasive surgical procedures and service fees related to the promotion and marketing of sports medicine allograft tissue. General surgery consists of a complete line of endo-mechanical instrumentation for minimally invasive laparoscopic and gastrointestinal procedures, smoke evacuation devices, a line of cardiac monitoring products as well as electrosurgical generators and related instruments.', 'Largo, FL, United States', 3900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVY', 'STOCK', 'Avery Dennison Corporation', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'A Avery Dennison Corporation é uma empresa global de soluções de ciência de materiais e identificação digital. A empresa fornece uma gama de soluções de branding e informação que otimizam a eficiência da mão-de-obra e da cadeia de fornecimento, reduzem o desperdício, promovem a sustentabilidade, a circularidade e a transparência, e conetam marcas e consumidores. Seu segmento de Grupo de Materiais fabrica e vende materiais de etiquetas sensíveis à pressão, filmes para produtos gráficos e reflexivos, fitas de desempenho e outros produtos adesivos para aplicações industriais, médicas e outras, bem como soluções de fixadores. Seu segmento Solutions Group projeta, fabrica e vende uma variedade de soluções de marca e informação, incluindo bilhetes de marca e preço, etiquetas e rótulos (incluindo inlays de identificação por radiofrequência (RFID)), e serviços relacionados, suprimentos e equipamentos. Ela atende uma variedade de indústrias em todo o mundo, incluindo cuidados domésticos e pesso', 'Mentor, OH, United States', 35000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CING', 'STOCK', 'Cingulate Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cingulate Inc. is a biopharmaceutical company. The Company is focused on the development, manufacturing, and commercialization of pharmaceutical products that utilize its precision timed release (PTR) drug delivery platform technology to create dosing schedules and drug release profiles. It focuses on the treatment of attention deficit/hyperactivity disorder (ADHD). The Company is in the development of two lead product candidates, such as CTx-1301 (dexmethylphenidate) and CTx-1302 (dextroamphetamine). The Companys CTx-1301 and CTx-1302 are being developed for the treatment of ADHD in the three core patient segments: children (ages 6-12), adolescents (ages 13-17), and adults (ages18+). In addition, the Company has a third product to treat anxiety, CTx-2103, in a formulation stage. Its CTx-1301, CTx-1302 and CTx-2103 drug candidates contain three releases of active pharmaceutical ingredient combined into one small tablet dosage form.', 'Kansas City, KS, United States', 13);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDJ', 'STOCK', 'BlackRock Enhanced Equity Dividend Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Enhanced Equity Dividend Trust is a closed-ended equity mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in the public equity markets of the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in dividend paying stocks of companies across all market capitalizations. The fund also invests through derivatives, with an emphasis on option writing. It benchmarks the performance of its portfolio against the Russell 1000 Value Index. The fund was formerly known as BlackRock Enhanced Dividend Achievers TM Trust. BlackRock Enhanced Equity Dividend Trust was formed on August 31, 2005 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FFIV', 'STOCK', 'F5, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'F5, Inc. É uma empresa de serviços e segurança de aplicativos multinuvem. A empresa faz parceria com várias organizações para proteger e otimizar cada interface de programação de aplicativos e aplicativos (API) em qualquer lugar - no local, na nuvem ou na borda. Os serviços de aplicativos de nível empresarial da empresa estão disponíveis como soluções baseadas em nuvem, software como serviço e somente software otimizadas para ambientes de várias nuvens, com módulos que podem ser executados independentemente ou como parte de uma solução integrada em seus dispositivos de alto desempenho. A empresa, por meio de seu produto Big IP, F5 NGINX e F5 Distributed Cloud Services, oferece uma gama de soluções integradas, baseadas em inteligência artificial e aprendizado de máquina que suportam o desempenho e protegem aplicativos e APIs legados e modernos em locais de data center, nuvem e borda. Seus produtos e soluções incluem F5 Distributed Cloud Web App e API Protection, F5 NGINX Ingress Control', 'Seattle, WA, United States', 6159);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNTB', 'STOCK', 'Connect Biopharma Holdings Limited', 'NGM', 'Healthcare', 'Biotechnology', 'Connect Biopharma Holdings Limited is a global clinical-stage biopharmaceutical company. The Company is focused on advancing rademikibart, a potentially best-in-class next generation anti-interleukin-4-receptor alpha (IL-4R?) antibody, to transform acute and chronic care in asthma and chronic obstructive pulmonary disease (COPD). Its lead product candidate, rademikibart, is an antibody designed to target interleukin-4 receptor alpha (IL-4R?) in development for the treatment of atopic dermatitis (AD) and asthma. As an inhibitor of IL-4R?, rademikibart blocks inflammatory signaling by both IL-4 and IL-13. The Company has completed a global Phase II trial (CBP-201-WW001) of rademikibart in adult patients with moderate-to-severe AD.', 'San Diego, CA, United States', 62);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCH', 'STOCK', 'Banco de Chile', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banco de Chile is a full service financial institution, which is engaged in providing credit and non-credit products and services in Chile. The Bank offers a range of banking services to its customers, ranging from individuals to corporations. The Bank''s segments include Retail, which focuses on individuals and small and medium-sized companies, where the product offering focuses on consumer loans, commercial loans, checking accounts, credit cards, credit lines and mortgage loans; Wholesale, which focuses on corporate clients and companies, where the product offering focuses on commercial loans, checking accounts and liquidity management services, debt instruments, foreign trade, derivative contracts and leases; Treasury, which includes the associated revenues to the management of the investment portfolio and the business of financial transactions and currency trading, and Subsidiaries, which corresponds to companies and corporations controlled by the Bank.', 'Santiago de Chile, , Chile', 11614);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDRX', 'STOCK', 'Biodexa Pharmaceuticals Plc', 'NCM', 'Healthcare', 'Biotechnology', 'Biodexa Pharmaceuticals PLC is a clinical-stage biopharmaceutical company. The Company is developing a pipeline of products for the treatment of diseases with unmet medical needs. The Companys lead development program, eRapa, is under development for familial adenomatous polyposis and non-muscle invasive bladder cancer; tolimidone, under development as a for the treatment of type 1 diabetes; and MTX110, which is being studied in aggressive rare/orphan brain cancer indications, including recurrent glioblastoma, diffuse midline glioma, or DMG, and medulloblastoma. Its technologies include Q-Sphera, MidaCore and MidaSolve. The Q-Sphera platform is a polymer microsphere microtechnology used for sustained delivery to prolong and control the release of therapeutics over an extended period of time, from weeks to months. Its MidaSolve platform is an oligosaccharide nanotechnology that is used to solubilize drugs so that they can be administered in liquid form directly and locally into tumors.', 'Cardiff, , United Kingdom', 13);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMP', 'STOCK', 'Ameriprise Financial, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Ameriprise Financial, Inc. É uma empresa diversificada de serviços financeiros. Os segmentos da empresa incluem Consultoria e Gestão de Riqueza, Gestão de Ativos, Soluções de Retirement & Protection e Corporate & Other. O segmento Advice & Wealth Management fornece planejamento financeiro e consultoria, bem como serviços de corretagem de serviço completo, principalmente para clientes de varejo através dos consultores da Companhia. O segmento Asset Management fornece gerenciamento de investimentos, consultoria e produtos para clientes de varejo, alto patrimônio líquido e institucionais em escala global através da marca Columbia Threadneedle Investments. Fornece produtos e serviços institucionais através de sua força de vendas institucional. O segmento de Soluções de Aposentadoria e Proteção inclui soluções de aposentadoria (anuidades variáveis e anuidades de pagamento) e soluções de proteção (seguro de renda de vida e invalidez). A Retirement Solutions fornece produtos de anuidade variá', 'Minneapolis, MN, United States', 13600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVTC', 'STOCK', 'EVERTEC, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'EVERTEC, Inc. É uma empresa de processamento de transações. A Empresa fornece uma gama de serviços de aquisição, processamento de pagamentos e gestão de processos de negócios. A Companhia atua através de três segmentos: Aquisição de Comerciantes, Processamento de Pagamentos e Soluções Empresariais. A partir de 31 de dezembro de 2016, gerenciou um sistema de redes de pagamento eletrônico que processou mais de dois bilhões de transações anualmente. Ele oferece uma gama de serviços para processamento de banco central, processamento de caixa e terceirização de tecnologia. Possui e opera a rede ATH, que é uma rede de débito com número de identificação pessoal (PIN) na América Latina. Ele atende a uma variedade de instituições financeiras, comerciantes, corporações e agências governamentais com soluções que lhes permitem emitir, processar e aceitar transações de forma segura. A gama de serviços da Empresa abrange toda a cadeia de valor de processamento de transações e inclui uma gama de solu', 'San Juan, PR, United States', 4800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNNE', 'STOCK', 'Cannae Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Cannae Holdings, Inc. primarily acquires interests in operating companies and is actively engaged in managing and operating a core group of those companies. Its segments include Restaurant Group, Alight, Black Knight Football and Entertainment (BKFE). The Restaurant Group segment consists of the operations of O''Charley''s and 99 Restaurants, in which it has 65.4% and 88.5% ownership interests, respectively. The Alight segment consists of its 7.6% ownership interest in Alight, which is a technology-enabled services company delivering human capital management solutions to many organizations. This includes the implementation and administration of employee benefits (health, wealth and leaves benefits) solutions. The Black Knight Football and Entertainment segment consists of its 47.2% ownership interest in BKFC, which owns and operates AFC Bournemouth, and a significant minority interest in FC Lorient, a French Ligue 1 football club.', 'Las Vegas, NV, United States', 7317);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARMG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long ARM Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSM', 'STOCK', 'Black Stone Minerals, L.P.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Black Stone Minerals, L.P., together with its subsidiaries, owns and manages oil and natural gas mineral interests. It owns mineral interests in approximately 16.8 million gross acres, nonparticipating royalty interests in 1.8 million gross acres, and overriding royalty interests in 1.6 million gross acres located in 41 states in the United States. The company was founded in 1876 and is based in Houston, Texas.', 'Houston, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSGX', 'STOCK', 'The Descartes Systems Group Inc.', 'NMS', 'Technology', 'Software - Application', 'The Descartes Systems Group Inc. is focused on logistics and supply chain management business processes. It provides on-demand, software-as-a-service (SaaS) solutions focused on improving the productivity, security and sustainability of logistics-intensive businesses. It allows customers to use its modular, SaaS solutions to route, track and help improve the safety, compliance of delivery resources; plan, allocate and execute shipments; rate, audit and pay transportation invoices; access global trade data; file customs and security documents for imports and exports; and complete other logistics processes by participating in the multimodal logistics community. Its solutions include cloud-based and consist of B2B service connectivity and messaging, broker and forwarder enterprise systems, global trade intelligence, regulatory compliance, e-commerce shipping, transportation management and routing. It also provides customs declaration software for logistics services providers and shippers.', 'Waterloo, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBRL', 'STOCK', 'Cracker Barrel Old Country Store, Inc.', 'NMS', 'Consumer Cyclical', 'Restaurants', 'Cracker Barrel Old Country Store, Inc. is engaged in the operation and development of the Cracker Barrel Old Country Store concept (Cracker Barrel). It operates 658 Cracker Barrel stores in 44 states and 68 Maple Street Biscuit Company stores in 10 states. The Companys format of its stores consists of a trademarked rustic old country-store design offering a full-service restaurant menu that features home-style country food and a wide variety of decorative and functional items such as rocking chairs, holiday and seasonal gifts, toys, apparel, cookware and foods. Its restaurants serve breakfast, lunch and dinner daily and offer dine-in, pick-up and delivery services. Its breakfast items include juices, eggs, pancakes, meats, grits, and a variety of biscuit specialties, such as gravy and biscuits and country ham and biscuits. Its Lunch and dinner items include fried and grilled chicken, chicken and dumplings, chicken pot pie, meatloaf, country fried steak, pork chops, fish, and more.', 'Lebanon, TN, United States', 77600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTX', 'STOCK', 'BlackRock Innovation and Growth Term Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Technology and Private Equity Term Trust is a mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. BlackRock Technology and Private Equity Term Trust is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNVS', 'STOCK', 'Cineverse Corp.', 'NCM', 'Communication Services', 'Entertainment', 'Cineverse Corp. is a global streaming technology and entertainment company. The Company''s business is operating as a portfolio of owned and operated streaming channels; a global aggregator and full-service distributor of feature films and television programs, and a technology software-as-a-service platform for over-the-top app development and content distribution through subscription video on demand (SVOD), dedicated ad-supported (AVOD), ad-supported streaming linear (FAST) channels, social video streaming services, and audio podcasts. Its streaming channels reach audiences in several distinct ways: direct-to-consumer, through these major application platforms, and through third party distributors of content on platforms. The Company''s streaming technology platform, known as Matchpoint, is a software-based streaming operating platform which provides clients with AVOD, SVOD, transactional video on demand (TVOD) and linear capabilities, automates the distribution of content, and others', 'New York, NY, United States', 213);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCU', 'STOCK', 'Invesco BulletShares 2030 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2030. It does not purchase all of the securities in the index; instead, the fund utilizes a "sampling" methodology to seek to achieve its investment objective.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('QVCGA', 'STOCK', 'QVC Group Inc.', 'NCM', 'Consumer Cyclical', 'Internet Retail', 'QVC Group, Inc., formerly Qurate Retail, Inc., is a live social shopping company that redefines the shopping experience through video-driven commerce on every screen, from smartphones and tablets to laptops and televisions. The Company''s retail brands include QVC, HSN, Ballard Designs, Frontgate, Garnet Hill and Grandin Road. The Company reaches more than 200 million homes worldwide via 15 television channels, which are available on cable/satellite television, free over-the-air television, and FAST and other digital livestreaming television. It also reaches millions of customers via its QVC+ and HSN+ streaming experience, Facebook, Instagram, TikTok, YouTube, Pinterest, websites, mobile apps, print catalogs, and in-store destinations. It also holds various minority interests.', 'Englewood, CO, United States', 18984);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CETY', 'STOCK', 'Clean Energy Technologies, Inc.', 'NCM', 'Industrials', 'Specialty Industrial Machinery', 'Clean Energy Technologies Inc. is a clean energy technology company offering eco-friendly green energy solutions, clean energy fuels and alternative electric power for small and mid-sized projects in North America, Europe, and Asia. The Companys segments include Clean Energy HRS & CETY Europe, CETY Renewables Waste to Energy Solutions, Engineering and Manufacturing Business and CETY HK. The Clean Energy HRS & CETY Europe segment provides waste heat recovery solutions, converting thermal energy to zero-emission electricity. The CETY Renewables Waste to Energy Solutions segment offers waste to energy technologies and solutions. The Engineering and Manufacturing Business provides customers with comprehensive design, manufacturing, and project management solutions. CETY HK is the parent company of its natural gas (NG) trading operations in China. Its principal products are Waste Heat Recovery Solutions, using its patented Clean Cycle generator to create electricity.', 'Irvine, CA, United States', 25);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIB', 'STOCK', 'Grupo Cibest S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'A Bancolombia S.A. (Bancolombia) é uma instituição financeira que oferece uma variedade de produtos e serviços financeiros para uma base diversificada de clientes individuais, corporativos e governamentais em toda a Colômbia, América Latina e região do Caribe. O Banco opera através de 10 segmentos: Banking Colombia, Banking Panama, Banking El Salvador, Arrendamento, Fiduciário, Banco de Investimentos, Corretagem, Off Shore e Todo o resto. Fornece seus produtos e serviços por meio de sua rede regional que compreende a rede bancária não governamental da Colômbia, o conglomerado financeiro de El Salvador por empréstimos brutos, o banco da Guatemala, o banco do Panamá e subsidiárias bancárias off-shore no Panamá, Cayman e Porto Rico, bem como subsidiárias no Peru. O Banco e suas subsidiárias oferecem Poupança e Investimento, Ahorro A La Mano, Financiamento, Banco Hipotecário, Factoring, Arrendamento Financeiro e Operacional, Mercado de Capitais, eTrading, Gerenciamento de Dinheiro, Moeda E', 'Medellín, , Colombia', 33993);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATO', 'STOCK', 'Atmos Energy Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'A Atmos Energy Corporation é um distribuidor exclusivo de gás natural. A empresa entrega gás natural a mais de 3,3 milhões de clientes de distribuição em mais de 1 400 comunidades em oito estados localizados principalmente no Sul. Ele gerencia ativos proprietários de dutos e armazenamento, incluindo sistemas de gasodutos intraestatais no Texas. Seus segmentos incluem distribuição e pipeline e armazenamento. O segmento de distribuição compreende sua distribuição regulamentada de gás natural e operações de vendas relacionadas em oito estados. O segmento de gasoduto e armazenamento é composto por operações de gasoduto e armazenamento reguladas de sua divisão Atmos Pipeline-Texas (APT) e suas operações de transmissão de gás natural na Louisiana. O APT é uma operação de gasoduto intraestatal no Texas com uma forte concentração nas áreas estabelecidas produtoras de gás natural do Texas central, norte e leste, estendendo-se para ou perto das principais áreas produtoras do xisto Barnet, da Cos', 'Dallas, TX, United States', 5260);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATMU', 'STOCK', 'Atmus Filtration Technologies Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Atmus Filtration Technologies Inc. is engaged in filtration and media solutions. The Company designs and manufactures advanced filtration products, principally under the Fleetguard brand, that enable lower emissions and provide superior asset protection. It serves customers across the truck, bus, agriculture, construction, mining, marine and power generation vehicle, and equipment markets, along with providing comprehensive aftermarket support and solutions. Its products include fuel filters, lube filters, air filters, crankcase ventilation, hydraulic filters and coolants and other chemicals. It offers products for first fit and aftermarket applications to original equipment manufacturers, dealers/distributors, and end-users. The Company produces and sells Fleetguard branded products across North America, Europe, South America, Asia, Australia, and the African continents. Its Fleetguard branded products are available through distribution centers worldwide.', 'Nashville, TN, United States', 4500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNED', 'STOCK', 'Barnes & Noble Education, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'Barnes & Noble Education, Inc. is a contract operator of physical and virtual bookstores for college and university campuses and K-12 institutions across the United States. The Company also textbook wholesalers and inventory management hardware and software providers. The Company operates through two segments: Retail, and Wholesale. The Retail Segment operates 1,245 college, university, and K-12 school bookstores, comprised of 707 physical bookstores and 538 virtual bookstores. The Wholesale Segment provided a comprehensive selection of new and used textbooks to approximately 2,750 physical bookstores, including its Retail segment''s 707 physical bookstores and sources, and distributes new and used textbooks to its 538 virtual bookstores. Additionally, the Wholesale Segment sells hardware and a software suite of applications that provides inventory management and point-of-sale solutions to approximately 325 college bookstores.', 'Basking Ridge, NJ, United States', 2520);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWT', 'STOCK', 'California Water Service Group', 'NYQ', 'Utilities', 'Utilities - Regulated Water', 'California Water Service Group is a holding company that provides water utility and other related services in California, Washington, New Mexico, Hawaii and Texas through its subsidiaries. Its business is conducted through its operating subsidiaries and provides utility services. Its business consists of the production, purchase, storage, treatment, testing, distribution, and sale of water for domestic, industrial, public, and irrigation uses, and the provision of domestic and municipal fire protection services. It provides wastewater collection and treatment services, including treatment which allows water recycling. It also provides non-regulated water-related services under agreements with municipalities and other private companies. The non-regulated services include full water system operation, meter reading, and billing services. Non-regulated operations also include the lease of communication antenna sites, lab services and promotion of other non-regulated services.', 'San Jose, CA, United States', 1278);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKU', 'STOCK', 'BankUnited, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'BankUnited, Inc. is a bank holding company of BankUnited (the Bank). The Bank provides a full range of commercial lending and both commercial and consumer deposit services through banking centers located in Florida, the New York metropolitan area and Dallas, Texas, and a comprehensive suite of wholesale products to customers through an Atlanta office focused on the Southeast region. The Banks lending products include commercial loans, commercial real estate loans, residential mortgages and other consumer loans. It offers traditional deposit products including commercial and consumer checking accounts, money market deposit accounts, savings accounts and certificates of deposit with a variety of terms and rates, as well as a robust suite of treasury, payments and cash management services. The Bank provides certain commercial lending and deposit products through national platforms and certain consumer deposit products through an online channel.', 'Miami Lakes, FL, United States', 1662);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACM', 'STOCK', 'AECOM', 'NYQ', 'Industrials', 'Engineering & Construction', 'AECOM is a global provider of professional infrastructure consulting and advisory services for governments, businesses and organizations throughout the world. It provides advisory, planning, consulting, architectural and engineering design, construction and program management services, and investment and development services to public and private clients worldwide in major end markets, such as transportation, facilities, water, environmental, and energy. Its Americas segment provides planning, consulting, architectural and engineering design, construction management and program management services to public and private clients in the United States, Canada, and Latin America. Its International segment provides planning, consulting, architectural and engineering design services and program management to public and private clients in Europe, the Middle East, India, Africa, and the Asia-Australia-Pacific regions. Its ACAP segment primarily invests in and develops real estate projects.', 'Dallas, TX, United States', 51000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVL', 'STOCK', 'Direxion Daily AVGO Bull 2X Shares', 'NGM', NULL, NULL, 'Australian Vanadium Limited is engaged in the advancement of the Australian Vanadium Project, exploration for vanadium/titanium and other economic resources, development of vanadium electrolyte production and the sale of vanadium flow batteries (VFB) systems. The Exploration segment includes Australian Vanadium Project and other exploration projects. The Energy storage segment include VSUN Energy Pty Limited''s vanadium redox flow battery marketing and sales activities. The Electrolyte Plant segment is its vanadium electrolyte manufacturing facility in Western Australia. The Australian Vanadium Project consists of V-Ti-Fe deposit located in the Murchison Province 43 kilometers (kms) south of the mining town of Meekatharra in Western Australia and 740 km north-east of Perth. The Project consists of 15 tenements covering 200 square km. The Coates Project is located in the Shire of Northam, approximately 60 km east of Perth. The Nowthanna Hill deposit is located 50 km south of Meekatharra', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALTS', 'STOCK', 'ALT5 Sigma Corporation', 'NCM', 'Technology', 'Software - Application', 'ALT5 Sigma Corporation is a fintech company providing blockchain-powered technologies for tokenization, trading, clearing settlement, payment and safe keeping of digital assets. The Company, through its subsidiary, ALT5 Sigma, Inc., provides blockchain-powered technologies to enable migration to a global financial paradigm. It offers two platforms to its customers: ALT5 Pay and ALT5 Prime. ALT5 Pay is a cryptocurrency payment gateway that enables registered and approved global merchants to accept and make cryptocurrency payments or to integrate the ALT5 Pay payment platform into their application or operations using the plugin with WooCommerce and or ALT5 Pay''s checkout widgets and APIs. ALT5 Prime is an electronic over-the-counter trading platform that enables registered and approved customers to buy and sell digital assets. The Company also owns Mswipe, which is a payment solutions provider offering multi-currency, fiat payment card services along with crypto-enabled capabilities.', 'Las Vegas, NV, United States', 10);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTAI', 'STOCK', 'BioXcel Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'BioXcel Therapeutics, Inc. is a biopharmaceutical company utilizing artificial intelligence to develop medicines in neuroscience. Its subsidiary, OnkosXcel Therapeutics LLC, is focused on the development of medicines in immuno-oncology. Its advanced neuroscience candidate, BXCL501, is an investigational, orally dissolving film formulation of dexmedetomidine in development for the treatment of agitation associated with psychiatric and neurological disorders. It is continuing to develop BXCL501 for the potential acute treatment of agitation associated with bipolar disorder or schizophrenia in the at-home setting and for the potential acute treatment of agitation (non-daily) associated with dementia due to probable Alzheimers disease in the at-home setting and in care facilities. Its advanced immuno-oncology candidate, BXCL701, is an investigational oral innate immune activator for the treatment of aggressive forms of prostate cancer, pancreatic cancer, and other solid and liquid tumors.', 'New Haven, CT, United States', 37);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACLX', 'STOCK', 'Arcellx, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Arcellx Inc. is a clinical-stage biotechnology company reimagining cell therapy by engineering immunotherapies for patients with cancer and other incurable diseases. Its lead program is a BCMA-targeting ddCAR product candidate called anitocabtagene autoleucel, which is being evaluated in its pivotal Phase II iMMagine-1 and the Phase III iMMagine-3 trials in patients with relapsed or refractory multiple myeloma (rrMM). Anitocabtagene is the first BCMA-directed CAR T-cell therapy to be investigated in multiple myeloma that utilizes its novel and compact binder known as the D-Domain. The small, stable D-Domain binder enables high CAR expression without tonic signaling and is designed to quickly release from the BCMA target. It is also developing two clinical-stage ARC-SparX programs in Phase I trials: ACLX-001, which targets BCMA in rrMM, and ACLX-002, which targets CD123 in relapsed or refractory acute myeloid leukemia (AML) and high-risk myelodysplastic syndrome (MDS).', 'Redwood City, CA, United States', 163);\n